import ReactDOM from "react-dom/client";

function App() {
  return (
    <div>
      <h2>Hello React!</h2>
      <Pizza />
    </div>
  );
}

function Pizza() {
  return <h2>Pizzas</h2>;
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
